import './App.css';

import useFetch from './hooks/useFetch.js';
import useObtainAuth from './hooks/useObtainAuth.js';
function App() {

  // obtain the bearer token
  const { token, loadingAuth, errorAuth } = useObtainAuth()


  const { data1, loading, error } = useFetch(token)


  return (
    <div className="App">
      {loading === true || loadingAuth === true ? (
        <div>Loading...</div>
      ) : (
        <>
          <h1>Users</h1>
          <table border={1}>
            <tr>
              <th>userId</th>
              <th>title</th>
              <th>completed</th>
            </tr>
            {data1.map(data => (
              <tr key={data.id}>
                <td>{data.userId}</td>
                <td>{data.title}</td>
                <td>{data.completed ? "true" : "false"}</td>
              </tr>
            ))}
          </table>
        </>
      )}
    </div>
  )
}

export default App;
